import React from 'react';
import Table from '@material-ui/core/Table';

const ApiData = ()=>{
    return (
        <>
        <Table>
            <tr>
                <td>State</td>
                <td>Confirmed</td>
                <td>Recovered</td>
                <td>Deaths</td>
                <td>Active</td>
                <td>Updated</td>
            </tr>
        </Table>
        </>
    )
}

export default ApiData;
